import React from 'react';

const SpotifyData = ({ topTracks }) => {
  
    return (
      <div>
        <h1>Your Top Spotify Tracks</h1>
        <ul>
          {topTracks.map(track => (
            <li key={track.id}>
              {track.name} by {track.artists.map(artist => artist.name).join(', ')}
            </li>
          ))}
        </ul>
      </div>
    );
  };
export default SpotifyData;
